  const imageSlides = [slide1, slide2, slide3];
  console.log(imageSlides);
  //   const { background } = homepage;
  return homepage.map((item, index) => {
    console.log(item);
    <div className="banner">
      <img src={slide1} alt="slide" />
      <h1 className="banner__subtitle">{item.subtitle}</h1>
      <h1 className="banner__title">{item.title}</h1>
      <p className="description">description</p>
      <div className="banner__buttons">
        <button className="banner__button">Order now</button>
        <button className="banner__button">View Menu</button>
      </div>
    </div>;
  });
};

export default Banner;
